import Axios from "axios";
import React from "react";

function AdminPage() {
  async function users(): any[] {
    return await Axios.get("http://localhost:3003/culto");
  }
  const signedUsers = users.map((user) => <li key={user.id}>{user.name}</li>);

  return (
    <div id="admin-page">
      <div className="content-wrapper">
        <ul>
          <li>Teste</li>
          <li>Teste</li>
          <li>Teste</li>
          <li>Teste</li>
          {users}
        </ul>
      </div>
    </div>
  );
}

export default AdminPage;
